import styled from "styled-components";
import { Link } from "react-router-dom";

const Container = styled.div`
    padding: 0px 20px;
`;

const Header = styled.header`
    height: 10vh;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const CoinsList = styled.ul``;
const Coin = styled.li`
    background-color: white;
    color: ${(props) => props.theme.bgColor};
    margin-bottom: 10px;
    padding: 20px;
    border-radius: 15px;
    a {
        display: block;
        transition: color 0.3s ease;
    }
    &:hover {
        a {
            color: ${(props) => props.theme.accentColor};
        }
    }
`;

const Title = styled.h1`
    color: ${(props) => props.theme.accentColor};
    font-size: 48px;
`;

//from https://api.coingecko.com/api/v3/coins/markets
const coins = [
    {
        id: "btc-bitcoin",
        name: "Bitcoin",
        symbol: "BTC",
        rank: 1,
        is_new: false,
        is_active: true,
        type: "coin",
    },
    {
        id: "eth-ethereum",
        name: "Ethereum",
        symbol: "ETH",
        rank: 2,
        is_new: false,
        is_active: true,
        type: "coin",
    },
    {
        id: "usdt-tether",
        name: "Tether",
        symbol: "USDT",
        rank: 3,
        is_new: false,
        is_active: true,
        type: "token",
    },
];
function Coins() {
    return (
        <Container>
            <Header>
                <Title>코인</Title>
            </Header>
            <CoinsList>
                {coins.map((each) => (
                    <Coin key={each.id}>
                        <Link to={`/${each.id}`}>{each.name}</Link>
                    </Coin>
                ))}
            </CoinsList>
        </Container>
    );
}

export default Coins;
